function contenedor(){window.setInterval(gameLoop,drawInterval)}function log(t,e){var a=document.getElementById("log");e?a.innerHTML+="<br/>"+t:a.innerHTML=t}function fpsUpdate(){var t=(new Date).getTime(),e=Math.ceil(t-lastFps);e>=1e3&&(currentFps=frameCount,frameCount=0,lastFps=t),frameCount++}function borrarCanvas(){ctx.clearRect(0,0,myCanvas.width,myCanvas.height)}function dibujarFondo(){ctx.strokeRect(0,0,myCanvas.width,myCanvas.height)}function dibujarRect(t,e){ctx.save(),ctx.fillStyle=e,ctx.fillRect(t.x,t.y,t.width,t.height),ctx.restore()}function dibujarTexto(t,e,a,n,r,o,c){ctx.save(),ctx.fillStyle=a,ctx.font=n+" "+r+" "+o,ctx.fillText(c,t,e),ctx.restore()}function dibujarFps(){dibujarTexto(10,20,"black","bold","12px","sans-serif","FPS: "+currentFps+"/"+maxfps)}function depurar(){}function gameLoop(){borrarCanvas(),fpsUpdate(),dibujarFondo(),dibujarFps(),depurar()}var myCanvas=document.getElementById("myCanvas"),ctx=myCanvas.getContext("2d"),maxfps=60,frameCount=0,currentFps=0,drawInterval=1e3/maxfps,lastFps=(new Date).getTime();myCanvas.width=300,myCanvas.height=300,contenedor();